import React from "react";
import { MDBContainer, MDBIframe } from "mdbreact";


const IframePage = () => {
  return (
    <MDBContainer className="text-center">
      <MDBIframe src="https://www.google.com/maps/embed/Eversmile+Dental+clinic/@19.404556,72.8371252,17z/data=!3m1!4b1!4m5!3m4!1s0x3be7a97f704ca6e7:0xc61be7734f93019e!8m2!3d19.4044705!4d72.8393532" />
    </MDBContainer>
  );
}

export default IframePage;
